export class IssuesCreate extends React.Component {

    render() {
        return (
            <div className={"flex border border-gray-600 w-full bg-[#30324E] rounded-bl-lg"}>
                <div className={"w-full py-3 px-4"}>
                    <h4> Create new Issue </h4>
                </div>
            </div>
        )
    }
}
